.jspContainer
{
	overflow: hidden;
	position: relative;
	z-index: 600;
}

.jspPane
{
	position: absolute;
}

.jspVerticalBar
{
	display: none !important;
	position: absolute;
	top: 0;
	right: 0;
	width: 16px;
	height: 100%;
	background: red;
}

.jspHorizontalBar
{
	position: absolute;
	bottom: 1px;
	left: 0;
	width: 100%;
	height: 16px;
	z-index:700;
}

.jspVerticalBar *,
.jspHorizontalBar *
{
	margin: 0;
	padding: 0;
}

.jspCap
{
	display: none;
}

.jspHorizontalBar .jspCap
{
	float: left;
}

.jspTrack
{
	background: #252e34;
	position: relative;
	height: 100%;
	-webkit-border-radius: 7px;
	-moz-border-radius: 7px;
	border-radius: 7px;
	-webkit-box-shadow: inset 1px 1px 3px 0px rgba(0, 0, 0, 75), 1px 1px 0px 0px #383e43;
	-moz-box-shadow: inset 1px 1px 3px 0px rgba(0, 0, 0, 75), 1px 1px 0px 0px #383e43;
	box-shadow: inset 1px 1px 3px 0px rgba(0, 0, 0, 75), 1px 1px 0px 0px #383e43;
}

.jspDrag
{
	background: #465560;
	position: relative;
	top: 3px;
	left: 3px;
	cursor: pointer;
	height: 10px;
	-webkit-border-radius: 5px;
	-moz-border-radius: 5px;
	border-radius: 5px;
}

.jspHorizontalBar .jspTrack,
.jspHorizontalBar .jspDrag
{
	float: left;
}

.jspArrow
{
	background: #50506d;
	text-indent: -20000px;
	display: block;
	cursor: pointer;
}

.jspArrow.jspDisabled
{
	cursor: default;
	background: #80808d;
}

.jspVerticalBar .jspArrow
{
	height: 16px;
}

.jspHorizontalBar .jspArrow
{
	width: 16px;
	float: left;
	height: 100%;
}

.jspVerticalBar .jspArrow:focus
{
	outline: none;
}

.jspCorner
{
	background: #eeeef4;
	float: left;
	height: 100%;
